import { useNavigate } from "react-router-dom"
import { deleteCookie } from "../../helpers/cookie";
import { useEffect } from "react";

function LogOut(){
    const navigate = useNavigate();
    deleteCookie();
    useEffect(()=>{
        navigate("/login");
    },[])
    return(
        <>
        </>
    )
}
export default LogOut
